on first order in the list\n    And User click on Return Items button\n    And User select the Return Reason 'Item damaged'\n    And User select the drop off service 'FedEx'\n    And User click on Return Order button\n    Then a cancelation message should be displayed ‘Return was successful’\n\n  @Regression\n  Scenario: Verify User can write a review on order placed\n    And User click on first order in list\n    And User click on Review button\n    And User write Review headline 'Product' and 'Bad quality'\n    And User click Add your Review button\n    Then a review message should be displayed ‘Your review was added successfully’\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"3bd13d6d-0e25-4fc9-9ea4-004ca5b7b926"},{"location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"197ab403-7dff-44fd-96a9-6c223aea5367"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'newStudentHS@tekschool.us' and password 'Tek@12345'","id":"1a387d91-b8d3-4d3d-a882-ca2096fac3b3"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"a81a34d5-006d-4b34-ab0e-a15d7674b509"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged in into Account","id":"c8cda13c-d54e-4ba0-a50f-a81f11866981"},{"location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User click on the category dropdown option","id":"e657
